Defendant Iffendell Roshan Hutchenson in court with attorney Darryl E. Smith.  Hanna Kolberg (plea only) and Denis John Stingl appeared for the State of Wisconsin.
On State's motion, Court ordered COUNTS 2 and 3 DISMISSED BUT READ IN.
AS TO COUNT 1: Defendant changes plea to GUILTY. Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty. Court found that defendant freely, voluntarily and intelligently waived his rights. Plea questionnaire received and filed. Parties stipulate to the complaint as a factual basis to sustain defendant's plea. Court found defendant guilty as charged in the information and ordered a Judgment of Conviction be entered on the record. Defendant is advised he is a convicted felon and may not possess any firearms. Defendant is advised he is unable to vote in any election until civil rights are restored. Defendant further advised that if he is not a US citizen deportation is possible.  


AS TO COUNT 1: The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 42 MONTHS, with credit for 101 days time served; the INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 18 MONTHS; the MAXIMUM TERM OF EXTENDED SUPERVISION is 24 MONTHS.  The defendant is eligible for the Challenge Incarceration Program and is eligible for the "Wisconsin Substance Abuse Program".
*AODA assessment and follow through with recommended programming; 
*Maintain absolute sobriety with random urine screens.
Defendant shall provide a DNA sample for the Data Bank and pay all appropriate costs by 6.15.15 or a civil judgment is ordered.
Court ordered defendant to pay all applicable court costs and surcharges by 6.15.15 or, if not paid, a civil judgment is ordered.
Court advised defendant that as a convicted felon he may never possess a firearm or body armor. Court advised defendant that his voting rights are suspended and he may not vote in any election until his civil rights are restored. 
